        [HttpGet]
        [Route("ObtenerDatosSolicitud")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<ActionResult<SolicitudCertificadoDto>> ObtenerDatosSolicitud()
        {
            var userId= _httpClientHelper.GetClaims().UserId;
            var serviceResponse = await _httpClientHelper.ConsumirServicioRest($"{uriAPI}/Certificado/ObtenerDatosSolicitud/{userId}",
             HttpMethod.Get, "");
            var res = await serviceResponse.Content.ReadAsStringAsync();
            if (serviceResponse.StatusCode == HttpStatusCode.OK)
            {
                var resul = JsonConvert.DeserializeObject<SolicitudCertificadoDto>(res);
                return Ok(resul);
            }

            ErroresDTO errors = JsonConvert.DeserializeObject<ErroresDTO>(res);
            return BadRequest(errors);
        }
        [HttpPost]
        [Route("RegistrarSolicitud")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<IActionResult> RegistrarSolicitud(SolicitudCertificadoDto solicitud)
        {
            string agreement = "ok";
            try
            {
                var path = Path.Combine(_env.ContentRootPath, "PlantillasContratos/TerminosCondicionesCertificado.txt");
                agreement = System.IO.File.ReadAllText(path);
            }
            catch { }

            RFDPostRequest rFDPostRequest = new RFDPostRequest("PersonaNatural", "");
            rFDPostRequest.SetDatos(solicitud.NombreCompleto, solicitud.NumeroDocumento, solicitud.Nombres,
                solicitud.Apellidos, solicitud.TipoDocumento, solicitud.NumeroDocumento, solicitud.Departamento,
                solicitud.Municipio, solicitud.PinFirma, solicitud.Notaria, solicitud.Direccion, solicitud.Cargo);
            rFDPostRequest.SetContacto(solicitud.Correo, solicitud.Celular);
            rFDPostRequest.SetTyc(solicitud.AceptarTyc,agreement);
            rFDPostRequest.AddFileEvidence("Documento.pdf", Convert.ToBase64String(solicitud.Cedula), await _keyManagerClient.GetIDType(solicitud.TipoDocumento));
            rFDPostRequest.AddFileEvidence("ActaYDecretoNombramiento.pdf", Convert.ToBase64String(solicitud.CComercio), "CertificadoCamaraComercio");
            rFDPostRequest.AddFileEvidence("RUT.pdf", Convert.ToBase64String(solicitud.Rut), "RUT");
            if(solicitud.Cargo=="Notario Encargado")
            {
                rFDPostRequest.AddFileEvidence("Documento_NotarioPrincipal.pdf", Convert.ToBase64String(solicitud.CedulaPrincipal), await _keyManagerClient.GetIDType(solicitud.TipoDocumentoNotarioPrincipal));
            }
            rFDPostRequest.AddFileEvidence("AutorizacionFirmada.pdf", Convert.ToBase64String(solicitud.Autorizacion), "AutorizacionFirmada");
            rFDPostRequest.AddFileEvidence("ContratoSuscripcion.pdf", Convert.ToBase64String(solicitud.Contrato), "ContratoSuscripcion");
            _logger.LogInformation($"Request Petition Key Manager: {JsonConvert.SerializeObject(rFDPostRequest)}");
            var responseRFD = await _keyManagerClient.Petition(rFDPostRequest);
            _logger.LogInformation($"Response Petition Key Manager: {JsonConvert.SerializeObject(responseRFD)}");
            if (!responseRFD.Success)
                return Ok(false);
            var userId = _httpClientHelper.GetClaims().UserId;
            CertificadoSelectedDTO certificadoSelected = new CertificadoSelectedDTO()
            {
                UsuarioCertificado = responseRFD.UserId,
                UsuarioId = userId
            };
            var serviceResponse = await _httpClientHelper.ConsumirServicioRest($"{uriAPI}/Certificado/ActualizarUsuarioNotario",
             HttpMethod.Post, certificadoSelected);
            if (serviceResponse.StatusCode == HttpStatusCode.OK)
            {
                return Ok(true);
            }
            return Ok(false);
        }
        [HttpPost]
        [Route("ObtenerAutorizacion")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<IActionResult> ObtenerAutorizacion(SolicitudCertificadoDto solicitud)
        {
            var plantilla = GetPlantillaAutorizacion(solicitud);
            try
            {
                //string base64Template = "";
                var path = Path.Combine(_env.ContentRootPath, "PlantillasContratos/autorizacion.pdf");
                byte[] bytesTemplate = System.IO.File.ReadAllBytes(path);
                string base64Template = Convert.ToBase64String(bytesTemplate);
                ItextImage firma = new ItextImage()
                {
                    Content = solicitud.Firma,
                    PageNumber = 1,
                    Position = new Point(300, 80),
                    ScalePercent = 14f
                };
                List<ItextImage> firmas = new List<ItextImage>(){ firma };
                return Ok(FillPdf(base64Template, plantilla,firmas));
            }
            catch (Exception e)
            {
                return BadRequest();
            }
        }
        [HttpPost]
        [Route("ObtenerContrato")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<IActionResult> ObtenerContrato(SolicitudCertificadoDto solicitud)
        {
            try
            {
                var path = Path.Combine(_env.ContentRootPath, "PlantillasContratos/contrato.pdf");
                byte[] bytesTemplate = System.IO.File.ReadAllBytes(path);
                string base64Template = Convert.ToBase64String(bytesTemplate);
                dynamic contractData;
                var pathContractData = Path.Combine(_env.ContentRootPath, "PlantillasContratos/DatosContratos.json");
                string contractContent = System.IO.File.ReadAllText(pathContractData);
                contractData = JsonConvert.DeserializeObject(contractContent);
                solicitud.NombreOPeradorThomas = contractData.OperadorThomas.Nombre;
                string strfirmaOperadorThomas = contractData.OperadorThomas.GrafoFirma;
                var plantilla = GetPlantillaContrato(solicitud);
                ItextImage firma = new ItextImage()
                {
                    Content = solicitud.Firma,
                    PageNumber = 3,
                    Position = new Point(300, 180),
                    ScalePercent = 14f
                };
                ItextImage firmaOperadorThomas = new ItextImage()
                {
                    Content = Convert.FromBase64String(strfirmaOperadorThomas),
                    PageNumber = 3,
                    Position = new Point(80, 200),
                    ScalePercent = 40f
                };
                List<ItextImage> firmas = new List<ItextImage>() { firma,firmaOperadorThomas };
                return Ok(FillPdf(base64Template, plantilla,firmas));
            }
            catch (Exception e)
            {
                return BadRequest();
            }
        }
        [HttpGet]
        [Route("ObtenerCertificados")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<ActionResult<IEnumerable<CertificadoDTO>>> ObtenerCertificados()
        {
            var claims = _httpClientHelper.GetClaims();
            var userId = claims.UserId;
            var email = claims.UserName;
            CertificadoSelectedDTO certificadoSelected = null;
            List<CertificadoDTO> certificadoDTOs = new List<CertificadoDTO>();

            var serviceResponse = await _httpClientHelper.ConsumirServicioRest($"{uriAPI}/Certificado/ObtenerCertificadoNotario/{userId}",
            HttpMethod.Get, "");
            var res = await serviceResponse.Content.ReadAsStringAsync();
            if (serviceResponse.StatusCode == HttpStatusCode.OK)
            {
                certificadoSelected = JsonConvert.DeserializeObject<CertificadoSelectedDTO>(res);
            }
            if(certificadoSelected!=null && !string.IsNullOrWhiteSpace(certificadoSelected.UsuarioCertificado))
            {
                var resul =  await _keyManagerClient.CertificateStatus("",email);
                _logger.LogInformation($"Response Get Certificates:{JsonConvert.SerializeObject(resul)}");
                if (resul.Success)
                {
                    certificadoDTOs = resul.Certificates.Select(c => c.Adaptar<CertificadoDTO>()).ToList();
                }
            }
            //certificadoDTOs.Add(new CertificadoDTO()
            //{
            //    IdCertificado=0,
            //    Descripcion = "Olimpia IT",
            //    Estado="Activo"
            //});
            List<int> idsToRemove = new List<int>();
            for(var i = 0; i < certificadoDTOs.Count; i++)
            {
                if(certificadoDTOs[i].IdCertificado==certificadoSelected.CertificadoId)
                {
                    certificadoDTOs[i].Seleccionado = true;
                }
                if (certificadoDTOs[i].Estado == "Inactivo" && string.IsNullOrWhiteSpace(certificadoDTOs[i].ValidoHasta))
                {
                    idsToRemove.Add(certificadoDTOs[i].IdCertificado);
                }
            }
            //if (certificadoDTOs.Count() == 1)
            //    idsToRemove.Add(0);
            certificadoDTOs.RemoveAll(c => idsToRemove.Contains(c.IdCertificado));
            return Ok(certificadoDTOs);
        }
        [HttpPost]
        [Route("ActualizarCertificadoNotario/{idCertificado}")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        public async Task<IActionResult> ActualizarCertificadoNotario(int idCertificado)
        {
            var userId = _httpClientHelper.GetClaims().UserId;
            CertificadoSelectedDTO certificadoSelected = new CertificadoSelectedDTO()
            {
                CertificadoId = idCertificado,
                UsuarioId = userId
            };
            var serviceResponse = await _httpClientHelper.ConsumirServicioRest($"{uriAPI}/Certificado/ActualizarCertificadoNotario",
            HttpMethod.Post, certificadoSelected);
            var res = await serviceResponse.Content.ReadAsStringAsync();
            if (serviceResponse.StatusCode == HttpStatusCode.OK)
            {
                return Ok(true);
            }
            return Ok(false);
        }
