        private byte[] FillPdf(string base64Template, IEnumerable<Parametro> parametros,List<ItextImage> firmas)
        {
            //string base64Template = "";
            byte[] pdfTemplate = Convert.FromBase64String(base64Template);
            PdfReader pdfReader = new PdfReader(pdfTemplate);
            MemoryStream pdfStream = new MemoryStream();
            PdfStamper pdfStamper = new PdfStamper(pdfReader, pdfStream);
            AcroFields pdfFormFields = pdfStamper.AcroFields;
            foreach (Parametro p in parametros)
            {
                pdfFormFields.SetField(p.NombreCampo, p.Valor);
            }

            foreach(ItextImage firma in firmas)
            {
                Stream inputImageStream = new MemoryStream(firma.Content);
                var pdfContentByte = pdfStamper.GetOverContent(firma.PageNumber);
                iTextSharp.text.Image image = iTextSharp.text.Image.GetInstance(inputImageStream);
                image.ScalePercent(firma.ScalePercent); 
                image.SetAbsolutePosition(firma.Position.X,firma.Position.Y);
                pdfContentByte.AddImage(image);
                inputImageStream.Close();
                inputImageStream.Dispose();
            }

            pdfStamper.FormFlattening = true;
            pdfReader.Close();
            pdfStamper.Close();
            pdfStream.Flush();
            pdfStream.Close();
            byte[] pdfArray = pdfStream.ToArray();
            return pdfArray;
        }
        #endregion
        private class ItextImage
        {
            public byte[] Content { get; set; }
            public int PageNumber { get; set; }
            public Point Position { get; set; }
            public float ScalePercent { get; set; }
